// src/components/Contact.jsx
import "../styles/main.css";

const Contact = () => (
    <section id="contact" className="section">
      <h2>Contact Me</h2>
      <p className="center-text">I'd love to connect and collaborate!</p>
      <ul className="contact-list">
        <li><strong>Email:</strong> <a href="mailto:karun.gopal@gmail.com">karun.gopal@gmail.com</a></li>
        <li><strong>LinkedIn:</strong> <a href="https://www.linkedin.com/in/karun-gopal/" target="_blank" rel="noreferrer">linkedin.com/in/karun-gopal</a></li>
        <li><strong>GitHub:</strong> <a href="https://github.com/karungop" target="_blank" rel="noreferrer">github.com/karungop</a></li>
      </ul>
    </section>
  );

  export default Contact;
